import Navbar from "./Navbar";

function Home() {
  return (
    <div className="Home">
      <Navbar />
      <div className="Wrap-Home">
        <div className="Home-Title">
          <h1 className="Title">
            Rezzyn 2022
          </h1>
        </div>
      </div>
    </div>
  );
}

export default Home;
